import React from 'react';
import './App.css';

class App extends React.Component {
  render() {
    const album01 = {
      title: 'The Dark Side of the Moon',
      artist: 'Pink Floyd',
      releaseYear: 1973,
      imagem:"https://upload.wikimedia.org/wikipedia/en/3/3b/Dark_Side_of_the_Moon.png",
      releaseDate: {
        day: 23,
        month: 'February',
        year: 1985
      },
      others: {
        recordCompany: "Compilot Parloni",
        formats: ["CD", "Vinil", "Digital"],
        goldStatus: 0
      }
    }
    return (
      <div className="App">
        {album01.others.formats.map((format, index) => (
          <li key={index}>{format}</li>
        ))}
        <h1>{album01.title}</h1>
        <h2>{album01.artist}</h2>
        <h3>{album01.releaseYear}</h3>
        <img src={album01.imagem} alt={album01.title} />
        <p>Release Date: {album01.releaseDate.day} {album01.releaseDate.month}, {album01.releaseDate.year}</p>
        <p>Record Company: {album01.others.recordCompany}</p>
        <p>Gold Status: {album01.others.goldStatus ? 'Yes' : 'No'}</p>
      </div>
    );
  }
}

export default App;
